import Layout from '../components/Layout';

const Index = ({posts}) => {
   //console.log(posts);
    return (
    <Layout>
        Hello world. home page
        <div>
            {posts.map((item, i) => (
                <h1 key={i}>{item}</h1>
               ) )}
        </div>
    </Layout>
    )
}

Index.getInitialProps = async (context) => {
    //console.log(context);
    return {
        posts: ['John', 'Jim', 'Jerry', 'Joseph', 'Jimmy']
    }
}

export default Index;
